import React, { useRef, useEffect, useState, useCallback, useMemo } from 'react';
import { IconButton, Paper } from '@mui/material';
import PlayCircleFilledIcon from '@mui/icons-material/PlayCircleFilled';
import PauseCircleFilledIcon from '@mui/icons-material/PauseCircleFilled';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import ZoomInIcon from '@mui/icons-material/ZoomIn';
import ZoomOutIcon from '@mui/icons-material/ZoomOut';
import { WaveSurfer, WaveForm } from "wavesurfer-react";

const TimelinePlugin = require("wavesurfer.js/dist/plugin/wavesurfer.timeline.min");

interface ExpandedPlayerProps {
  url: string;
  isPlay: boolean;
  setIsPlay: (play: boolean) => void;
  currentTime: number;
  setCurrentTime: (time: number) => void;
  setIsExpanded: (expanded: boolean) => void;
}

const ExpandedPlayer: React.FC<ExpandedPlayerProps> = ({
  url,
  isPlay,
  setIsPlay,
  currentTime,
  setCurrentTime,
  setIsExpanded,
}) => {
  const [zoom, setZoom] = useState(10);
//   const wavesurferRef = useRef<WaveSurfer | null>(null);

//   const handleWSMount = useCallback((waveSurfer: WaveSurfer) => {
//     wavesurferRef.current = waveSurfer;
//     wavesurferRef.current.load(url);

//     wavesurferRef.current.on("ready", () => {
//       wavesurferRef.current?.setCurrentTime(currentTime);
//       if (isPlay) {
//         wavesurferRef.current?.play();
//       }
//     });

//     wavesurferRef.current.on("audioprocess", () => {
//       if (wavesurferRef.current) {
//         setCurrentTime(wavesurferRef.current.getCurrentTime());
//       }
//     });
//   }, [url, currentTime, isPlay, setCurrentTime]);

  const plugins = useMemo(() => [
    {
      plugin: TimelinePlugin,
      options: { container: "#timeline" },
    },
  ], []);

  const wavesurferRef = useRef<any>(null);

  const handleWSMount = useCallback((waveSurfer) => {
    wavesurferRef.current = waveSurfer;
    wavesurferRef.current.load(url);

    wavesurferRef.current.on("ready", () => {
      wavesurferRef.current?.setCurrentTime(currentTime);
      if (isPlay) {
        wavesurferRef.current?.play();
      }
    });

    wavesurferRef.current.on("audioprocess", () => {
      if (wavesurferRef.current) {
        setCurrentTime(wavesurferRef.current.getCurrentTime());
      }
    });
  }, [url, currentTime, isPlay]);

  useEffect(() => {
    if (wavesurferRef.current) {
      wavesurferRef.current.zoom(zoom);
    }
  }, [zoom]);

  useEffect(() => {
    if (wavesurferRef.current) {
      if (isPlay) {
        wavesurferRef.current.play();
      } else {
        wavesurferRef.current.pause();
      }
    }
  }, [isPlay]);

  const handlePlayPause = () => {
    setIsPlay(!isPlay);
  };

  const handleZoomIn = () => {
    setZoom(prevZoom => Math.min(prevZoom * 2, 1000));
  };

  const handleZoomOut = () => {
    setZoom(prevZoom => Math.max(prevZoom / 2, 5));
  };

  return (
    <Paper
      elevation={3}
      style={{
        position: "fixed",
        bottom: 0,
        left: 0,
        width: "100%",
        zIndex: 1000,
        padding: "10px",
        boxSizing: "border-box",
        height: "400px",
        overflow: "auto",
      }}
    >
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <div>
          <IconButton
            color="primary"
            size="medium"
            onClick={handlePlayPause}
          >
            {isPlay ? <PauseCircleFilledIcon fontSize="large" /> : <PlayCircleFilledIcon fontSize="large" />}
          </IconButton>
          <IconButton
            color="primary"
            size="medium"
            title="Увеличить масштаб"
            onClick={handleZoomIn}
          >
            <ZoomInIcon fontSize="large" />
          </IconButton>
          <IconButton
            color="primary"
            size="medium"
            title="Уменьшить масштаб"
            onClick={handleZoomOut}
          >
            <ZoomOutIcon fontSize="large" />
          </IconButton>
        </div>
        <IconButton
          color="primary"
          size="medium"
          onClick={() => setIsExpanded(false)}
        >
          <ExpandMoreIcon fontSize="large" />
        </IconButton>
      </div>
      <div style={{ width: "100%", position: "relative", marginTop: "10px" }}>
          <WaveSurfer onMount={handleWSMount} plugins={plugins}>
            <WaveForm
              id="waveform"
              waveColor="#b7e1dd"
              progressColor="#4Db6AC"
              cursorColor="#357F78"
              splitChannels={true}
            />
            <div style={{ height: "20px" }} id="timeline" />
          </WaveSurfer>
      </div>
    </Paper>
  );
};

export default ExpandedPlayer;
